const bgm = document.getElementById('bgm');
const startBtn = document.getElementById('start');
const overlay = document.getElementById('overlay');
const sEl = document.getElementById('s'), bEl = document.getElementById('b');
const mobileToggle = document.getElementById('mobileToggle');
const mobileCtrls = document.getElementById('mobileCtrls');
const leftBtn = document.getElementById('leftBtn'), rightBtn = document.getElementById('rightBtn'), jumpBtn = document.getElementById('jumpBtn');
let mobileOn=false;

// tamper-resistant best score (client-side)
let BEST = 0;
const STORAGE_KEYS = ['dodori_a','dodori_b','dodori_c'];
async function sha256(str){ const enc = new TextEncoder().encode(str); const buf = await crypto.subtle.digest('SHA-256', enc); return Array.from(new Uint8Array(buf)).map(b=>b.toString(16).padStart(2,'0')).join(''); }
const sessionSeed = Math.floor(Math.random()*1e12).toString(36) + '|' + navigator.userAgent.slice(0,64);
function encodeBest(score){ const payload = JSON.stringify({s:score, t:Date.now(), r: Math.floor(Math.random()*1e9)}); const pepper='p0pM3ga!'; return sha256(sessionSeed+'::'+payload+'::'+pepper).then(h=> btoa(payload)+'|'+h); }
async function decodeBest(st){ try{ const [b,sig]=st.split('|'); const payload=atob(b); const pepper='p0pM3ga!'; const h=await sha256(sessionSeed+'::'+payload+'::'+pepper); if(h!==sig) return null; const obj=JSON.parse(payload); return obj.s||0; }catch(e){ return null; } }
async function saveBest(score){ try{ const enc=await encodeBest(score); for(const k of STORAGE_KEYS) localStorage.setItem(k,enc); localStorage.setItem('dodori_mirror', btoa(JSON.stringify({v:score,x:(score*13^7)}))); }catch(e){} }
async function loadBest(){ try{ const vals = STORAGE_KEYS.map(k=>localStorage.getItem(k)); if(vals.every(v=>v===null)) return 0; const out=[]; for(const v of vals){ if(!v) continue; const s=await decodeBest(v); if(typeof s==='number') out.push(s); } if(!out.length) return 0; const counts=out.reduce((m,v)=>{m[v]=(m[v]||0)+1;return m;},{}); const best=Number(Object.keys(counts).reduce((a,b)=> counts[a]>counts[b]?a:b)); try{ const m=localStorage.getItem('dodori_mirror'); if(m){ const mm=JSON.parse(atob(m)); if(Math.abs(mm.v-best)>0) return 0; } }catch(e){ return 0; } return best; }catch(e){ return 0; } }
let antiTamperLocked=false, antiTamperSnapshot=null;
async function takeSnapshot(){ const s=STORAGE_KEYS.map(k=>localStorage.getItem(k)).join('::'); antiTamperSnapshot = await sha256((s||'')+'::'+sessionSeed); }
async function checkSnapshot(){ if(antiTamperLocked) return; const s=STORAGE_KEYS.map(k=>localStorage.getItem(k)).join('::'); const now = await sha256((s||'')+'::'+sessionSeed); if(antiTamperSnapshot && now!==antiTamperSnapshot){ for(const k of STORAGE_KEYS) localStorage.removeItem(k); localStorage.removeItem('dodori_mirror'); antiTamperLocked=true; BEST=0; bEl.textContent=BEST; } }

(async()=>{ BEST = await loadBest(); bEl.textContent=BEST; await takeSnapshot(); })();

// game state
let running=false, over=false, score=0;
let speed=300; let spawnMin=1.8, spawnMax=2.4;
let tSpawn=0, nextSpawn=1.9;
let tFall=0, nextFallTarget=2.8, fallChance=0.0;
let lastShieldMilestone=0;
const move = {left:false,right:false};
const MOVE_SPEED = 460; const DESCENT_MULT = 1.75;

// audio sfx
function hasShield(t){ return P && P.shieldUntil && t < P.shieldUntil; }
function grantShield(until){ P.shieldUntil = until; P.shield = true; P.shieldFlash = 0; }

let audioCtx=null, sfxGain=null;
function initAudio(){ if(audioCtx) return; audioCtx=new (window.AudioContext||window.webkitAudioContext)(); sfxGain=audioCtx.createGain(); sfxGain.gain.value=0.5; sfxGain.connect(audioCtx.destination); }
function tone(freq=760,dur=0.10,type='square',vol=0.5){ if(!audioCtx) return; const t=audioCtx.currentTime, o=audioCtx.createOscillator(), g=audioCtx.createGain(); o.type=type; o.frequency.setValueAtTime(freq,t); g.gain.value=vol; g.gain.exponentialRampToValueAtTime(0.0001,t+dur); o.connect(g); g.connect(sfxGain); o.start(t); o.stop(t+dur+0.02); }
function sfxJump(){ tone(760,0.08,'square',0.5); }
function sfxPass(){ tone(660,0.06,'triangle',0.4); setTimeout(()=>tone(880,0.07,'sine',0.5),60); }
function sfxShield(){ tone(520,0.12,'sine',0.5); setTimeout(()=>tone(1040,0.08,'square',0.4),80); }
function sfxPop(){ tone(180,0.18,'sawtooth',0.5); }

// mobile ui
mobileToggle.addEventListener('click', ()=>{ mobileOn=!mobileOn; mobileCtrls.style.display = mobileOn?'block':'none'; mobileToggle.textContent = mobileOn?'📱 모바일 조작: 켬':'📱 모바일 조작: 끔'; });
function bindHold(btn,key){ const on=()=>move[key]=true; const off=()=>move[key]=false; btn.addEventListener('pointerdown',e=>{e.preventDefault();on();}); btn.addEventListener('pointerup',off); btn.addEventListener('pointercancel',off); btn.addEventListener('pointerleave',off); }
bindHold(leftBtn,'left'); bindHold(rightBtn,'right'); jumpBtn.addEventListener('pointerdown',e=>{e.preventDefault();jump();});

// input
function jump(){ if(!running||over) return; if(P.grounded){ P.vy=-P.j; P.grounded=false; sfxJump(); } }
addEventListener('keydown',e=>{ if(e.code==='Space'||e.code==='Tab'||e.code==='ArrowUp'){e.preventDefault();jump();} if(e.code==='ArrowLeft') move.left=true; if(e.code==='ArrowRight') move.right=true; });
addEventListener('keyup',e=>{ if(e.code==='ArrowLeft') move.left=false; if(e.code==='ArrowRight') move.right=false; });
addEventListener('pointerdown',e=>{ if(e.target===startBtn) return; if(!mobileOn) jump(); });

// obstacles
function makeGroundObstacle(){
  const r=Math.random(); let type='static';
  if(r<0.16) type='short'; else if(r<0.34) type='tall'; else if(r<0.58) type='bouncer'; else if(r<0.82) type='slider'; else type='spinner';
  const base=Math.max(U*1.0, U*1.1); let w=base,h=base,y=ground-base,spin=0,bobAmp=base*0.08,bobSpeed=0.9+Math.random()*0.6;
  if(type==='short'){ h=base*0.85; y=ground-h; }
  if(type==='tall'){ h=base*1.2; y=ground-h; }
  if(type==='spinner'){ w=base*1.4; h=base*0.5; y=ground-h-10; spin=(Math.random()<0.5?1:-1)*(1.0+Math.random()*1.4); }
  if(type==='slider'){ y=ground-h-(Math.random()*U*0.3); bobAmp=base*0.22; }
  if(type==='bouncer'){ bobAmp=base*0.14; }
  const rushProb = 0.07 + Math.min(0.12, score/12000*0.12);
  const rush = Math.random() < rushProb;
  const speedMul = rush ? (1.8 + Math.random()*0.6) : 1.0;
  return {kind:'ground', type, x:W+w, y, w, h, t:0, bobAmp, bobSpeed, rot:(Math.random()*0.06-0.03), spin, cleared:false, rush, speedMul};
}
function makeFallingObstacle(){
  const size=Math.max(U*0.9,U*1.0);
  const x=Math.random()*(W-size*1.2)+size*0.6;
  const vy=(H*0.35+Math.random()*H*0.25);
  const rot=(Math.random()<0.5?-1:1)*(0.8+Math.random()*1.4);
  return {kind:'fall', x, y:-size*1.2, w:size, h:size, vy, rot, t:0, cleared:false};
}
function makeCharger(){
  const size = Math.max(U*0.9, U*1.05);
  const APEX = (P.j*P.j)/(2*P.g);
  const y = ground - P.h - Math.max(U*0.6, Math.min(APEX*0.95, APEX*1.05));
  const speedFactor = 1.6 + Math.random()*0.8;
  return {kind:'charger', x: W + size, y, w:size, h:size, vx: -(speed*speedFactor), t:0, cleared:false};
}
function makeCounterEnemy(){
  const base=Math.max(U*1.0, U*1.1); const size=base*1.0;
  return {kind:'enemy', x:-size-20, y:ground-size, w:size, h:size, vx: speed*(1.1+Math.random()*0.2), cleared:false};
}
function A(a,b){ return a.x < b.x + b.w && a.x + a.w > b.x && a.y < b.y + b.h && a.y + a.h > b.y; }

// background
function bg(t){ const hue=(200 + Math.sin(t*0.1)*5)|0; const sky=ctx.createLinearGradient(0,0,0,H); sky.addColorStop(0,`hsl(${hue},90%,85%)`); sky.addColorStop(1,`hsl(${(hue+15)%360},95%,96%)`); ctx.fillStyle=sky; ctx.fillRect(0,0,W,H); ctx.globalAlpha=0.8; drawClouds(t*12,H*0.22,1.0); ctx.globalAlpha=0.55; drawClouds(t*20,H*0.30,0.7); ctx.globalAlpha=1.0; ctx.fillStyle='#b9e6a6'; drawHills(12,H*0.70,0.8); ctx.fillStyle='#93d38b'; drawHills(0,H*0.76,1.0); ctx.fillStyle='#7fcf6b'; ctx.fillRect(0,ground,W,H-ground); }
function drawClouds(offset,y,scale){ const cw=Math.max(160*DPR,U*2.0)*scale; for(let x=-cw*2;x<W+cw*2;x+=cw*1.1) blob((x-(offset%cw)),y,cw*0.9,cw*0.5); }
function blob(x,y,w,h){ ctx.beginPath(); ctx.ellipse(x,y,w*0.45,h*0.45,0,0,Math.PI*2); ctx.ellipse(x-w*0.3,y+h*0.05,w*0.35,h*0.35,0,0,Math.PI*2); ctx.ellipse(x+w*0.3,y+h*0.05,w*0.35,h*0.35,0,0,Math.PI*2); ctx.fillStyle='rgba(255,255,255,0.95)'; ctx.fill(); }
function drawHills(offsetX,baseY,scale){ const step=Math.max(220*DPR,U*2.4)*scale; ctx.beginPath(); ctx.moveTo(0,H); for(let x=-step*2;x<=W+step*2;x+=step){ const h = Math.sin((x+offsetX)/step)*28*DPR + 34*DPR; ctx.lineTo(x+offsetX, baseY - h); } ctx.lineTo(W,H); ctx.closePath(); ctx.fill(); }

// difficulty
let lastChargerTime = 0;
let lastRushTime = 0;
const NO_PAIR_WINDOW = 2200; // ms
function updateDifficulty(){
  const d = Math.min(1.5, score/9000);
  speed = 300 + d*320;
  spawnMin = 1.6 - d*0.6;
  spawnMax = 2.2 - d*0.7;
  if(score < 1000){ nextFallTarget = 3.0; fallChance = 0.0; } else { const fd = Math.min(1.0,(score-1000)/9000); nextFallTarget = 2.5 - fd*1.1; fallChance = 0.2 + fd*0.4; }
}

// loop
let last=0, raf=0;
function loop(now){
  raf = requestAnimationFrame(loop);
  if(!last) last = now;
  const dt = Math.min(0.033,(now-last)/1000); last = now;
  if(!running) return;

  score += dt*36; sEl.textContent = Math.floor(score);
  updateDifficulty();
  if(Math.floor(now/1000) % 5 === 0) checkSnapshot();

  tSpawn += dt; if(tSpawn >= nextSpawn){ const gObs = makeGroundObstacle();
  // prevent pairing: if recent charger, cancel rush
  if(gObs.rush && (now - lastChargerTime) < NO_PAIR_WINDOW){ gObs.rush=false; gObs.speedMul=1.0; }
  if(gObs.rush){ lastRushTime = now; }
  obs.push(gObs); tSpawn = 0; nextSpawn = spawnMin + Math.random()*(spawnMax-spawnMin); }
  tFall += dt; if(tFall >= nextFallTarget){ if(Math.random() < fallChance) falls.push(makeFallingObstacle()); tFall = 0; }
  if(Math.random() < 0.003 + Math.min(0.012, score/15000*0.012)){
    if((now - lastChargerTime) > 2500 && (now - lastRushTime) > NO_PAIR_WINDOW){ obs.push(makeCharger()); lastChargerTime = now; }
  }
  if(Math.random() < (score>3000 ? Math.min(0.08, 0.02 + (score-3000)/14000) * dt*2 : 0)) obs.push(makeCounterEnemy());

  P.vx = (move.left?-1:0) + (move.right?1:0);
  P.x += P.vx * MOVE_SPEED * dt;
  if(P.x < 0) P.x = 0; if(P.x + P.w > W) P.x = W - P.w;

  const isFalling = P.vy > 0; P.vy += P.g * (isFalling? DESCENT_MULT:1.0) * dt; P.y += P.vy * dt;
  if(P.y + P.h >= ground){ P.y = ground - P.h; P.vy = 0; P.grounded = true; }

  const milestone = Math.floor(score/2500);
  if(milestone > lastShieldMilestone){ lastShieldMilestone = milestone; friends.push({x:W+U, y:ground-U*2.0, w:U*0.9, h:U*0.9, vx:-speed*0.6, vy:0, t:0, taken:false}); }

  bg(now/1000);
  const px = P.x, py = P.y;
  if(playerImg.naturalWidth) ctx.drawImage(playerImg, px, py, P.w, P.h); else { ctx.fillStyle='#fff'; ctx.fillRect(px,py,P.w,P.h); }
  if(hasShield(now)){
  P.shieldFlash = (P.shieldFlash + dt) % 1.0;
  const pulse = 0.4 + Math.sin(P.shieldFlash*6.283)*0.12;
  ctx.save();
  ctx.globalAlpha = pulse;
  ctx.shadowColor = '#66e0ff';
  ctx.shadowBlur = 14*DPR;
  ctx.strokeStyle = '#66e0ff';
  ctx.lineWidth = 6*DPR;
  ctx.beginPath();
  ctx.ellipse(P.x+P.w/2, P.y+P.h/2, P.w*0.62, P.h*0.62, 0,0,Math.PI*2);
  ctx.stroke();
  ctx.restore();
}

  for(let i=friends.length-1;i>=0;i--){ const f=friends[i]; f.t+=dt; f.x += f.vx*dt; const bob = Math.sin(f.t*2.4)*(U*0.10); const cx=f.x, cy=f.y + bob; ctx.save(); ctx.globalCompositeOperation='lighter'; ctx.shadowColor='#aef'; ctx.shadowBlur=12*DPR; if(friendImg.naturalWidth) ctx.drawImage(friendImg, cx, cy, f.w, f.h); else { ctx.fillStyle='#aef'; ctx.fillRect(cx, cy, f.w, f.h); } ctx.restore(); const rect={x:cx,y:cy,w:f.w,h:f.h}; if(!f.taken && A({x:P.x,y:P.y,w:P.w,h:P.h},rect)){ f.taken=true; grantShield(now + 10000); sfxShield(); } if(f.x + f.w < -60 || f.taken) friends.splice(i,1); }

  for(let i=obs.length-1;i>=0;i--){ const o=obs[i];
    if(o.kind==='enemy'){ o.x += o.vx*dt; } else if(o.kind==='charger'){ o.x += o.vx*dt; o.t += dt; } else { const mul = o.speedMul||1.0; o.x -= (speed*mul)*dt; o.t += dt; }
    let drawY = o.y, ang = o.rot||0;
    if(o.type==='bouncer') drawY = o.y + Math.sin((o.t||0)*2.4*(o.bobSpeed||1))*(o.bobAmp||0);
    else if(o.type==='slider') drawY = o.y + Math.sin((o.t||0)*1.8*(o.bobSpeed||1))*(o.bobAmp||0), ang *= 0.5;
    else if(o.type==='spinner') ang = (o.t||0) * (o.spin||0);
    ctx.save(); const cx = o.x + o.w/2, cy = drawY + o.h/2; ctx.translate(cx, cy); ctx.rotate(ang);
    if(o.kind==='charger'){ if(chargerImg.naturalWidth) ctx.drawImage(chargerImg, -o.w/2, -o.h/2, o.w, o.h); else { ctx.fillStyle='#ff9'; ctx.fillRect(-o.w/2,-o.h/2,o.w,o.h); } }
    else if(o.kind==='enemy'){ if(enemyImg.naturalWidth) ctx.drawImage(enemyImg, -o.w/2, -o.h/2, o.w, o.h); else { ctx.fillStyle='#555'; ctx.fillRect(-o.w/2,-o.h/2,o.w,o.h); } }
    else { if(obsImg.naturalWidth) ctx.drawImage(obsImg, -o.w/2, -o.h/2, o.w, o.h); else { ctx.fillStyle='#9c6d3b'; ctx.fillRect(-o.w/2,-o.h/2,o.w,o.h); } if(o.rush){ ctx.globalAlpha=0.35; ctx.fillStyle='#ff6b6b'; ctx.fillRect(o.w*0.1,-o.h*0.05,o.w*0.55,o.h*0.10); ctx.globalAlpha=1.0; } }
    ctx.restore();
    const rect = {x: o.x + o.w*0.18, y: drawY + o.h*0.15, w: o.w*0.64, h: o.h*0.70 };
    if(A({x:P.x,y:P.y,w:P.w,h:P.h}, rect)){ if(hasShield(now)){
  P.shieldFlash = (P.shieldFlash + dt) % 1.0;
  const pulse = 0.4 + Math.sin(P.shieldFlash*6.283)*0.12;
  ctx.save();
  ctx.globalAlpha = pulse;
  ctx.shadowColor = '#66e0ff';
  ctx.shadowBlur = 14*DPR;
  ctx.strokeStyle = '#66e0ff';
  ctx.lineWidth = 6*DPR;
  ctx.beginPath();
  ctx.ellipse(P.x+P.w/2, P.y+P.h/2, P.w*0.62, P.h*0.62, 0,0,Math.PI*2);
  ctx.stroke();
  ctx.restore();
} else { gameOver(); break; } }
    if(!o.cleared && ((o.kind==='enemy' && (o.x>W+o.w)) || (o.kind!=='enemy' && (P.x > o.x + o.w)))){ o.cleared=true; sfxPass(); }
    if((o.kind==='enemy' && o.x>W+o.w+40) || (o.kind!=='enemy' && o.x + o.w < -40)) obs.splice(i,1);
  }

  for(let i=falls.length-1;i>=0;i--){ const f=falls[i]; f.t += dt; f.y += f.vy*dt; ctx.save(); const cx = f.x + f.w/2, cy = f.y + f.h/2; ctx.translate(cx, cy); ctx.rotate(f.t * f.rot); if(fallImg.naturalWidth) ctx.drawImage(fallImg, -f.w/2, -f.h/2, f.w, f.h); else { ctx.fillStyle='#88a'; ctx.fillRect(-f.w/2,-f.h/2,f.w,f.h); } ctx.restore(); const rect={x:f.x+f.w*0.15, y:f.y+f.h*0.15, w:f.w*0.70, h:f.h*0.70}; if(A({x:P.x,y:P.y,w:P.w,h:P.h}, rect)){ if(hasShield(now)){
  P.shieldFlash = (P.shieldFlash + dt) % 1.0;
  const pulse = 0.4 + Math.sin(P.shieldFlash*6.283)*0.12;
  ctx.save();
  ctx.globalAlpha = pulse;
  ctx.shadowColor = '#66e0ff';
  ctx.shadowBlur = 14*DPR;
  ctx.strokeStyle = '#66e0ff';
  ctx.lineWidth = 6*DPR;
  ctx.beginPath();
  ctx.ellipse(P.x+P.w/2, P.y+P.h/2, P.w*0.62, P.h*0.62, 0,0,Math.PI*2);
  ctx.stroke();
  ctx.restore();
} else { gameOver(); break; } } if(!f.cleared && (f.y>ground)){ f.cleared=true; sfxPass(); } if(f.y - f.h > H + 40) falls.splice(i,1); }
}

// game over/start
function gameOver(){ over=true; running=false; cancelAnimationFrame(raf); overlay.style.display='flex'; startBtn.textContent='다시 시작'; const sc = Math.floor(score); if(sc>BEST){ BEST=sc; bEl.textContent=BEST; saveBest(BEST); } try{ bgm.pause(); }catch(e){} }
function start(){ overlay.style.display='none'; running=true; over=false; score=0; speed=300; tSpawn=0; nextSpawn=1.9; obs.length=0; falls.length=0; friends.length=0; tFall=0; nextFallTarget=2.8; fallChance=0.0; lastChargerTime=0; lastShieldMilestone=0; P.x = Math.floor(W*0.20); P.y = ground - P.h; P.vy=0; P.grounded=true; P.shield=false; P.shieldFlash=0; P.shieldUntil=0; bgm.volume=0.18; try{ bgm.currentTime=0; bgm.play().catch(()=>{}); }catch(e){} try{ initAudio(); audioCtx && audioCtx.resume && audioCtx.resume(); }catch(e){} last=0; cancelAnimationFrame(raf); raf=requestAnimationFrame(loop); }
startBtn.addEventListener('click', start);
setInterval(()=>{ if(!antiTamperLocked) takeSnapshot(); }, 5000);
bg(0);
})();
</script>
</body>
